"use client"

import { useState, useEffect } from "react"
import { X } from "lucide-react"
import api from "../services/api"
import "./Modal.css"

const CreateTaskModal = ({ isOpen, onClose, onCreate, isSubtask, parentTaskTitle, listId }) => {
  const [title, setTitle] = useState("")
  const [description, setDescription] = useState("")
  const [isSubmitting, setIsSubmitting] = useState(false)
  const [existingTasks, setExistingTasks] = useState([])
  const [error, setError] = useState("")

  useEffect(() => {
    // Fetch existing tasks to check for duplicates within the same list/parent
    if (isOpen && listId) {
      const fetchTasks = async () => {
        try {
          const response = await api.get(`/api/todos/tasks/${listId}`)
          // Extract task titles at the current level (top-level or under the same parent)
          const tasks = response.data
          const relevantTasks = isSubtask ? tasks.find((t) => t.title === parentTaskTitle)?.subtasks || [] : tasks

          setExistingTasks(relevantTasks.map((task) => task.title.toLowerCase()))
        } catch (error) {
          console.error("Failed to fetch tasks:", error)
        }
      }

      fetchTasks()
    }
  }, [isOpen, listId, isSubtask, parentTaskTitle])

  useEffect(() => {
    // Reset form when modal opens
    if (isOpen) {
      setTitle("")
      setDescription("")
      setError("")
    }
  }, [isOpen])

  if (!isOpen) return null

  const validateTitle = (title) => {
    if (!title.trim()) {
      setError("Task title cannot be empty")
      return false
    }

    if (existingTasks.includes(title.trim().toLowerCase())) {
      setError(`A ${isSubtask ? "subtask" : "task"} with this name already exists`)
      return false
    }

    setError("")
    return true
  }

  const handleSubmit = async (e) => {
    e.preventDefault()

    if (!validateTitle(title)) return

    setIsSubmitting(true)
    try {
      await onCreate({ title, description })
      setTitle("")
      setDescription("")
      setError("")
      onClose()
    } catch (error) {
      setError("Failed to create task. Please try again.")
      console.error(error)
    } finally {
      setIsSubmitting(false)
    }
  }

  return (
    <div className="modal-overlay">
      <div className="modal">
        <div className="modal-header">
          <h2>{isSubtask ? `Add Subtask to "${parentTaskTitle}"` : "Create New Task"}</h2>
          <button onClick={onClose} className="close-button">
            <X size={20} />
          </button>
        </div>
        <form onSubmit={handleSubmit}>
          <div className="modal-body">
            {error && <div className="modal-error">{error}</div>}

            <div className="form-group">
              <label htmlFor="title">Title</label>
              <input
                type="text"
                id="title"
                value={title}
                onChange={(e) => setTitle(e.target.value)}
                placeholder="Task title"
                autoFocus
              />
            </div>

            <div className="form-group">
              <label htmlFor="description">Description (optional)</label>
              <textarea
                id="description"
                value={description}
                onChange={(e) => setDescription(e.target.value)}
                placeholder="Add details about this task"
                rows={4}
              />
            </div>
          </div>

          <div className="modal-footer">
            <button type="button" className="button secondary" onClick={onClose} disabled={isSubmitting}>
              Cancel
            </button>
            <button type="submit" className="button primary" disabled={isSubmitting}>
              {isSubmitting ? "Creating..." : isSubtask ? "Add Subtask" : "Create Task"}
            </button>
          </div>
        </form>
      </div>
    </div>
  )
}

export default CreateTaskModal;
